            outX = (int((((((x+1)/2))-0.5)/2)*511) << 22) & 0x3FC00000
            outY = (int((((((y+1)/2))-0.5)/2)*511) << 12) & 0x000FF000
            outZ = (int((((((z+1)/2))-0.5)/2)*511) << 2) & 0x000003FC
            return struct.pack(">I", outX|outY|outZ)

