                    pixels[(((ty*4)+y)*width+((tx*4)+x))*4+0] = block[(y*4+x)*4+0]
                    pixels[(((ty*4)+y)*width+((tx*4)+x))*4+1] = block[(y*4+x)*4+1]
                    pixels[(((ty*4)+y)*width+((tx*4)+x))*4+2] = block[(y*4+x)*4+2]
